import React, { Component } from "react";

import Button from "./RestaurantContainer/Button";
import OpenNow from "./RestaurantContainer/OpenNow";
import RatingsFilter from "./RestaurantContainer/RatingsFilter";

class FilterBar extends Component {
    state = {
        buttons: [{ id: 1, name: "Cuisine" }, { id: 2, name: "Rating" }]
    };
    render() {
        return ( <
            section className = "filterBar__wrapper" >
            <
            OpenNow / > {
                this.state.buttons.map(button => ( <
                    Button key = { button.id } > { button.name } < /Button>
                ))
            } <
            RatingsFilter / >
            <
            /section>
        );
    }
}

export default FilterBar;
